import '../App.css';
import ReservoirData from './ReservoirData';
import reservoirIDs from '../constants/reservoirIDs';
import axios from 'axios';
import React, { useState, useEffect } from 'react';

function Main() {

    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        axios.get('https://cdec.water.ca.gov/dynamicapp/req/JSONDataServlet?Stations=EXC&SensorNums=15&dur_code=D&Start=2023-07-24&End=2023-08-24')
            .then(response => {
                setData(response.data);
            })
            .catch(error => {
                setError(error);
                setLoading(false);
            })
    })

    const resCards = reservoirIDs.map((res) => {
        return (
            <ReservoirData name={res.name} id={res.id} />
        )
    }
    )

    const clickHandler = () => {
        console.log("clicked!");
    }

    return (
        <div className="App">
            <div className="App-background">
                <button onClick={clickHandler}>Click me!</button>
                {resCards}
            </div>
        </div >
    );
}

export default Main;
